function initContent(container) {
	$('.fancyboxgallery', container).fancybox();



	$('.owl-carousel', container).each(function(index) {
		var slider_autoplay = $(this).is('[data-autoplay]') ? true : false;
		var slider_startPosition = $(this).is('[data-index]') ? $(this).data('index') : 0;
		var slider_loop = $(this).is('[data-noloop]') ? false : true;
		var slider_nav = $(this).is('[data-nonav]') ? false : true;
		var slider_dots = $(this).is('[data-nodots]') ? false : true;
		$(this).owlCarousel({
			items: 1,
			autoplay: slider_autoplay,
			autoplayTimeout: 5000,
			autoplayHoverPause: true, // Stops autoplay
			mouseDrag: false,
			touchDrag: true,
			startPosition: slider_startPosition,
			loop: slider_loop,
			nav: slider_nav,
			dots: slider_dots,
			navText: ['<span></span>','<span></span>'],
			theme: ''
		});
	});


}

$(function() {
	$('.hidden_input').on('change',function(e){
		 if ($(this).val() == 'Oui'){
			 $(this).parents().next()[0].classList.remove('d-none');
		 }
		if ($(this).val() == 'Non'){
			$(this).parents().next()[0].classList.add('d-none');
		}
	});
	$('body').on('focus show.bs.select', '.form-control', function (e){
		$($(this).parents('.form-group').get(0)).find('label').animate({
			top: '-15px',
			fontSize: '12px'
		});
	}).on('blur change changed.bs.select', '.form-control:not(.bootstrap-select)', function(e) {
		if ($(this).val() == "") {
			$($(this).parents('.form-group').get(0)).find('label').animate({
				top: '0px',
				fontSize: '15px'
			});
		}

	});

	var profession_array = ['Agriculteurs exploitants',
		'Artisans', 'Commerants','Chefs dentreprise',
	'Cadres et professions intellectuelles suprieures',
	'Professions', 'Intermdiaires', 'Employs', 'Ouvriers',
	'Retraits','Freelance','Autre'];

	function listProfession(){
		var select_content = '';
		select_content = '<option value=""></option>';
		for (var i=0; i<profession_array.length; i++){
			var option = '<option value="'+profession_array[i]+'">'+profession_array[i]+'</option>';
			select_content += option;
		}
		return select_content;
	}
	$('#frm_trouver_nb_acheteurs').on('change', function(){
		var nb_acheteur = parseInt($(this).val());
		var nb_inputs = $('#container_acheteurs .acheteur').get().length;
		console.log('nb_input ' +nb_inputs  + '  nb_acheteur ' +nb_acheteur);
		if( nb_inputs < nb_acheteur ) {
			for (i=nb_inputs; i < nb_acheteur; i++) {
				var random = Math.floor((Math.random() * 100) + 1);
				$('#container_acheteurs').append('<div class="form-group acheteur"><label class="" for="frm_trouver_profession_acheteur_'+ random +'">Profession de l\'acheteur n<span class="number"></span></label><select id="frm_trouver_profession_acheteur_'+ random +'"type="text" name="profession_acheteur[]" class="form-control">'+ listProfession()+'</select></div>');
			}
		}
		else if( nb_inputs > nb_acheteur ) {
			for (i=nb_acheteur; i < nb_inputs; i++) {
				$('#container_acheteurs .acheteur:eq(-1)').remove();
			}
		}
		else if( !nb_acheteur){
			$('#container_acheteurs .acheteur').remove();
		}
		$('#container_acheteurs .acheteur').each(function(i, el) {
			$('.number', el).html(i + 1);
		});

	});

	$(".js-range-slider").ionRangeSlider({
		type: "double",
		min: 0,
		max: 1000,
		from: 100,
		to: 300,
		grid: false
	});

	$('body').on('focus', '.nofocus', function() {
		$(this).blur();
	});

	$('body').on('submit', '.form-ajax', function(e) {
		e.preventDefault();
		$frm = $(this);
		$('button[type="submit"]', $frm[0]).prop('disabled', true);
		$.ajax({
			type: $frm[0].method,
			url: $frm[0].action,
			dataType: 'json',
			data: $frm.serialize()
		}).done(function(data) {
			if(data.success == 1) {
				$frm[0].reset();
			}
			$('.frm_zone_message', $frm[0]).html(data.response);
			$('button[type="submit"]', $frm[0]).prop('disabled', false);
		});
	});

	function hideSearchForm(e) {
		if( !$(e.target).parents('#navbarNav').get().length && !$(e.target).is('#navbarNav') ) {
			$('#searchbox .form-control-container').removeClass('active');
			$('#searchbox button').attr('type', 'button');
			$('body').off('click', hideSearchForm);
		}
	}

	$('#searchbox button').click(function(e) {
		if( $('#searchbox button').attr('type') == 'button' ) {
			e.preventDefault();
			$('#searchbox .form-control-container').addClass('active');
			$('#searchbox button').attr('type', 'submit');
			$('#searchbox .form-control-container .form-control').trigger('focus');
			$('body').on('click', hideSearchForm);
		}
	});



	initContent($('#main > .page')[0]);


// accept cookies
	$('.link_accept_cookies').click(function(e) {
		e.preventDefault();
		$('#cookies_banner').fadeOut();
		loadGA();
		$.get( $_ROOT + '?_rgpd_ok=1' );
	});


// pages biens vendus
	$('#btn_page_biens_vendus').on('click', function(e) {
		e.preventDefault();
		var $this = $(this);
		$.get( $this.data('href') + $this.data('page'), function( data ) {
			$('#container-biens').append(data.content);
			if( data.page )
				$('#btn_page_biens_vendus').data('page', data.page);
			else
				$('#btn_page_biens_vendus').remove();
		}, "json" );
	});

	if( $('#mapid[data-lat][data-lng]').length ) {
		var lat = parseFloat($('#mapid').data('lat'));
		var lng = parseFloat($('#mapid').data('lng'));
		var mymap = L.map('mapid').setView([lat, lng], 15);

		var theKub = L.icon({
			iconUrl: $_ROOT + 'img/pointer.png',

			iconSize: [74, 74], // size of the icon
			iconAnchor: [37, 37], // point of the icon which will correspond to marker's location
			shadowAnchor: [4, 62],  // the same for the shadow
			popupAnchor: [-10, -30] // point from which the popup should open relative to the iconAnchor
		});
		var marker = L.marker([lat, lng], {icon: theKub}, 15).addTo(mymap);
		L.tileLayer('https://cartodb-basemaps-{s}.global.ssl.fastly.net/light_all/{z}/{x}/{y}.png', {
			maxZoom: 18,
		}).addTo(mymap);
	}



});


